import React, { useState, Component } from 'react';
import './App.css';

const App = () => {
  let [allSrc, setAllSrc] = useState(["https://pbs.twimg.com/profile_images/949787136030539782/LnRrYf6e_400x400.jpg",
  "data:image/jpeg;base64,",
  "data:image/jpeg;base64,",
  "data:image/jpeg;base64,",
  "data:image/jpeg;base64,",
  ]);
  let [best, setBest] = useState(0);
  let [score, setScore] = useState(0);
  let [hitImg, setHitImg] = useState([]);
  function shuffle(array) {
    let currentIndex = array.length,  randomIndex;
  
    // While there remain elements to shuffle...
    while (currentIndex != 0) {
  
      // Pick a remaining element...
      randomIndex = Math.floor(Math.random() * currentIndex);
      currentIndex--;
  
      // And swap it with the current element.
      [array[currentIndex], array[randomIndex]] = [
        array[randomIndex], array[currentIndex]];
    }
  
    return array;
  }
  const checkIfEnd = (num) => {
    for(let i = 0; i < hitImg.length; i++){
      if(hitImg[i] === num){
        return true
      }
    }
    return false
  }
  const handleClick0 = () => {
    setScore(score + 1)
    setHitImg(hitImg.concat([0]))
    if(checkIfEnd(0) === true){
      if(score > best){
        setBest(score);
      }
      setScore(0);
      setHitImg([]);
    }
    setAllSrc(shuffle(allSrc));
  }
  const handleClick1 = () => {
    setScore(score + 1)
    setHitImg(hitImg.concat([1]))
    if(checkIfEnd(1) === true){
      if(score > best){
        setBest(score);
      }
      setScore(0);
      setHitImg([]);
    }
    setAllSrc(shuffle(allSrc));
  }
  const handleClick2 = () => {
    setScore(score + 1)
    setHitImg(hitImg.concat([2]))
    if(checkIfEnd(2) === true){
      if(score > best){
        setBest(score);
      }
      setScore(0);
      setHitImg([]);
    }
    setAllSrc(shuffle(allSrc));
  }
  const handleClick3 = () => {
    setScore(score + 1)
    setHitImg(hitImg.concat([3]))
    if(checkIfEnd(3) === true){
      if(score > best){
        setBest(score);
      }
      setScore(0);
      setHitImg([]);
    }
    setAllSrc(shuffle(allSrc));
  }
  const handleClick4 = () => {
    setScore(score + 1)
    setHitImg(hitImg.concat([4]))
    if(checkIfEnd(4) === true){
      if(score > best){
        setBest(score);
      }
      setScore(0);
      setHitImg([]);
    }
    setAllSrc(shuffle(allSrc));
  }
  const handleClick = (src) => {
    if(src === "https://pbs.twimg.com/profile_images/949787136030539782/LnRrYf6e_400x400.jpg"){
      console.log("first src selected")
      handleClick0();
    }
    if(src === "data:image/jpeg;base64,"){
      console.log("second src selected")
      handleClick1();
    }
    if(src === "data:image/jpeg;base64,"){
      console.log("third src selected")
      handleClick2();
    }
    if(src === "data:image/jpeg;base64,"){
      console.log("fourfth src selected")
      handleClick3();
    }
    if(src === "data:image/jpeg;base64,"){
      console.log("fifth src selected")
      handleClick4();
    }
  }
  return (
    <div className="container">
      <img src={allSrc[0]} className="img img0" alt="" onClick={() => handleClick(allSrc[0])}></img>
      <img src={allSrc[1]} className="img img1" alt="" onClick={() => handleClick(allSrc[1])}></img>
      <img src={allSrc[2]} className="img img2" alt="" onClick={() => handleClick(allSrc[2])}></img>
      <img src={allSrc[3]} className="img img3" alt="" onClick={() => handleClick(allSrc[3])}></img>
      <img src={allSrc[4]} className="img img4" alt="" onClick={() => handleClick(allSrc[4])}></img>
      <div>
        <div>{"personal best: " + best}</div>
        <div>{"current score: " + score}</div>
      </div>
    </div>
  );
}

export default App;
